import React, {useState, useEffect} from 'react'


function DataFetching() {
    const [post, setPost] = useState([]);



    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/posts")
            .then(res => {
                return res.json();
            })
            .then(res => {
                setPost(res)
            })
    }, []);

  return (
    <div className="post">

            {post && post.map(post => {
            return <div><li key={post.id}>
            {post.id}
            {post.title}
            </li></div>
        })}

    </div>
  )
}
export default DataFetching
